// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract SimpleWallet {
    struct Transaction {
        address from;
        address to;
        uint timestamp;
        uint amount;
    }

    Transaction[] public transactionHistory;

    address public owner;
    bool public stop;

    event Transfer(address receiver, uint amount);
    event Receiver(address sender, uint amount);
    event ReceiverUser(address sender, address receiver, uint amount);
    event EmergencyStatusChanged(bool status);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "You don't have access");
        _;
    }

    mapping(address => uint) public suspiciousUser;

    modifier getSuspiciousUser(address _sender) {
        require(suspiciousUser[_sender] < 5, "Activity suspicious, try later");
        _;
    }

    modifier isNotEmergency() {
        require(!stop, "Emergency declared!");
        _;
    }

    function toggleStop() external onlyOwner {
        stop = !stop;
        emit EmergencyStatusChanged(stop);
    }

    function changeOwner(address newOwner) public onlyOwner isNotEmergency {
        require(newOwner != address(0), "Invalid owner address");
        owner = newOwner;
    }

    function transferToContract(uint _startTime)
        external
        payable
        getSuspiciousUser(msg.sender)
    {
        require(block.timestamp >= _startTime, "Send after start time");
        transactionHistory.push(
            Transaction(msg.sender, address(this), block.timestamp, msg.value)
        );
    }

    function transferToUserViaContract(address payable _to, uint _weiAmount)
        external
        onlyOwner
    {
        require(address(this).balance >= _weiAmount, "Insufficient balance");
        _to.transfer(_weiAmount);
        transactionHistory.push(
            Transaction(msg.sender, _to, block.timestamp, _weiAmount)
        );
        emit Transfer(_to, _weiAmount);
    }

    function withdrawFromContract(uint _weiAmount) external onlyOwner {
        require(address(this).balance >= _weiAmount, "Insufficient balance");
        payable(owner).transfer(_weiAmount);
        transactionHistory.push(
            Transaction(address(this), owner, block.timestamp, _weiAmount)
        );
    }

    function getContractBalanceInWei() external view returns (uint) {
        return address(this).balance;
    }

    function transferToUserViaMsgValue(address _to) external payable {
        require(_to != address(0), "Invalid address");
        payable(_to).transfer(msg.value);
        transactionHistory.push(
            Transaction(msg.sender, _to, block.timestamp, msg.value)
        );
    }

    function receiveFromUser() external payable {
        require(msg.value > 0, "Amount must be > 0");
        payable(owner).transfer(msg.value);
        emit ReceiverUser(msg.sender, owner, msg.value);
        transactionHistory.push(
            Transaction(msg.sender, owner, block.timestamp, msg.value)
        );
    }

    function getOwnerBalanceWei() external view returns (uint) {
        return owner.balance;
    }

    receive() external payable {
        transactionHistory.push(
            Transaction(msg.sender, address(this), block.timestamp, msg.value)
        );
        emit Receiver(msg.sender, msg.value);
    }

    function suspiciousActivity(address _sender) public {
        suspiciousUser[_sender] += 1;
    }

    fallback() external payable {
        suspiciousActivity(msg.sender);
    }

    function getTransactionHistory()
        external
        view
        returns (Transaction[] memory)
    {
        return transactionHistory;
    }

    function emergencyWithdraw() external onlyOwner {
        require(stop == true, "Emergency not declared");
        payable(owner).transfer(address(this).balance);
    }
}

